import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import React from 'react'

function MenuItem(props) {
    return (
      <div className='MenuItem'>
          <span>{props.name}</span>
          <FontAwesomeIcon icon={props.icon} />
      </div>
    );
}

  export default MenuItem;
